public static Element getFirstChildElement(Element element)
{
	for (Node kid = element.getFirstChild(); kid != null; kid = kid
			.getNextSibling())
	{
		if (kid.getNodeType() == Node.ELEMENT_NODE) 
		{
			return (Element) kid;
		}
	}
	return null;
}

